  `rarity` int DEFAULT NULL,
  `previous_kinsect_id` int DEFAULT NULL,
  `recipe_id` int DEFAULT NULL,
  `attack_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `dust_effect` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `power` int DEFAULT NULL,
  `speed` int DEFAULT NULL,
  `heal` int DEFAULT NULL,
  `final` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `previous_kinsect_id` (`previous_kinsect_id`),
  KEY `recipe_id` (`recipe_id`),
  CONSTRAINT `kinsect_ibfk_1` FOREIGN KEY (`previous_kinsect_id`) REFERENCES `kinsect` (`id`),
  CONSTRAINT `kinsect_ibfk_2` FOREIGN KEY (`recipe_id`) REFERENCES `recipe_item` (`recipe_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
