INSERT INTO `monster_text` VALUES (1,1,'de','Aptonoth',NULL,'Ein sanftmtiger Pflanzenfresser, der im Rudel grast. Sein Fleisch gilt als Delikatesse und ist nhrstoffreich. Wird ein Mitglied der Herde angegriffen, flieht der Rest.',NULL,NULL,NULL),(2,2,'de','Jagras',NULL,'Das Rudel eines Gross-Jagras besteht aus Exemplaren dieses kleineren Monsters. Sieht er einen der seinen sterben, flieht er. Frchtet sich nicht vor grsseren Gegnern.',NULL,NULL,NULL),(3,3,'de','Mernos',NULL,'Dieser Flugdrache ernhrt sich von Streunssen. Im Schwarm legt er grosse Entfernungen zurck, was ihn zum wertvollen Transportmittel schlauer Jger macht.',NULL,NULL,NULL),(4,4,'de','Vespoid',NULL,'Der Vespoid ist bekannt dafr, seine Opfer mit seinem langen Stachel zu lhmen. Er zerbricht leicht, also nutze deine Schleuder oder setze Gift ein, um an seine Materialien zu kommen.',NULL,NULL,NULL),(5,5,'de','Mosswine',NULL,'Der Mosswine ist fr seinen exzellenten Geruchssinn bekannt, der oft zur Pilzsuche genutzt wird. Folge einem Mosswine und schlage dir den Wanst voll!',NULL,NULL,NULL),(6,6,'de','Apceros',NULL,'Dieser Pflanzenfresser lebt in der Wildturm-dnis und hat eine besonders dicke Haut entwickelt, um Angreifer abzuwehren. Er sucht den Schutz der Gruppe zur Verteidigung.',NULL,NULL,NULL),(7,31,'de','Rathalos','Flug-Wyvern','Das Apex-Monster des Uralten Waldes, bekannt als \"Knig der Lfte\". Ein schrecklicher Wyvern, der auf Eindringlinge herabstsst und mit Giftklauen und Feueratem angreift.',NULL,NULL,NULL),(8,7,'de','Kestodon',NULL,'Der weibliche Kestodon alarmiert die Herde bei Gefahr, der mnnliche attackiert ohne Zurckhaltung. Rennende Exemplare knnen jedoch geblockt und dann angegriffen werden.',NULL,NULL,NULL),(9,8,'de','Noios',NULL,'Dieser Flugdrache gibt ein Gerusch von sich, das an eine Schreikapsel erinnert, wenn er berrascht wird. Locke ihn mit Fleisch an und tte ihn fr Materialien oder nutze ihn als Transport.',NULL,NULL,NULL),(10,9,'de','Gajau',NULL,'Grausamer Fischwyvern, der Eindringlinge gerne mit Gruppenhilfe vertreibt. Komm seinem Lebensraum nicht zu nahe...',NULL,NULL,NULL),(11,10,'de','Kelbi',NULL,'Ein kleiner Pflanzenfresser, bekannt fr seinen Sanftmut und die medizinischen Eigenschaften seiner Hrner. Bist du auch auf sie aus, greife vor allem den Kopf an.',NULL,NULL,NULL),(12,11,'de','Raphinos',NULL,'Ein Flugdrache aus dem Korallenhochland. Im Gruppenverbund stiehlt er die Eier von anderen Tieren, was die Aufmerksamkeit von grsseren Monstern erregt.',NULL,NULL,NULL),(13,32,'de','Diablos','Flug-Wyvern','Das Apex-Monster der Wildturm-dnis. Ein bedrohliches, territoriales Biest, das im Untergrund lauert. Laute Gerusche locken es an die Oberflche, um Beute zu machen.',NULL,NULL,NULL),(14,12,'de','Shamos',NULL,'Ein kleines, nachtaktives Monster, das besonders anfllig fr den Blitz des Tzitzi-Ya-Ku ist. Wie so viele andere kleine Kreaturen fhlt er sich in der Gruppe stark.',NULL,NULL,NULL),(15,13,'de','Girros',NULL,'Ein weiteres Rudelmonster, allerdings nutzt dieses hier das tdliche Miasma im Tal der Verwesung zu seinem Vorteil. Feinde werden mit lhmenden Fangzhnen ausgeschaltet.',NULL,NULL,NULL),(16,33,'de','Kirin','Drachenltester','Der Kirin ist ein solch seltener Anblick, dass man kaum etwas ber seine kologie weiss. Angeblich hllt sein Krper sich in reine Elektrizitt, wenn er provoziert wird.',NULL,NULL,NULL),(17,14,'de','Hornetaur',NULL,'Ein kleines Insekt, das bevorzugt an Land gefunden wird. Es greift jeden an, der ihm zu nahe kommt. Sammle seine Materialien, indem du ihn mit der Schleuder angreifst.',NULL,NULL,NULL),(18,15,'de','Gastodon',NULL,'Das Rudelmonster in der Heimat der ltesten reagiert gereizt auf Eindringlinge und greift Monster von doppelter Grsse an.',NULL,NULL,NULL),(19,34,'de','Zorah Magdaros','Drachenltester','Ein Drachenltester, der sich wie ein Vulkan aus der Erde erhebt. Wohin er will, und warum, will die Forschungskommission herausfinden.',NULL,NULL,NULL),(20,35,'de','Dodogama','Reisszahn-Wyvern','Der Dodogama verschlingt Felsen als Hauptnahrungsquelle. Kristalle daraus mischen sich mit seinem Speichel und die so entstandenen explosiven Mineralien spuckt er auf Gegner.',NULL,NULL,NULL),(21,16,'de','Barnos',NULL,'Ein feuriger Flugdrache, fr den die Lebensbedingungen nicht harsch genug sein knnen. Eindringlinge werden im Gruppenverbund mit einer Art Sure angegriffen.',NULL,NULL,NULL),(22,36,'de','Rosa Rathian','Flug-Wyvern','Eine Unterart der Rathian mit leuchtend rosa Schuppen. Die Rosa Rathian schwingt ihren toxischen Schwanz geschickter und schwcht ihre Beute mit Gift, bevor sie sie ttet.',NULL,NULL,NULL),(23,101,'de','Pepe',NULL,'Ein Pflanzenfresser mit langem Fell, der in der Tundra heimisch ist. Starker Fluchtinstinkt, Mnnchen verteidigen aber ihre Jungen.',NULL,NULL,NULL),(24,37,'de','Bazelgeuse','Flug-Wyvern','Ein ruchloser Flugwyvern, der die Neue Welt auf der Suche nach Beute bereist. Er kann explosive Schuppen verteilen, die Opfer in Flammen hllen.',NULL,NULL,NULL),(25,102,'de','Anteka',NULL,'Pflanzenfresser der Tundra, die etwas aggressiver sind als Kelbi und ihre Hrner verwenden, um Angreifer abzuwehren.',NULL,NULL,NULL),(26,103,'en','Wulg',NULL,'Miniature fanged wyverns of the Hinterlands. They doggedly stalk prey as a pack, and will attack even foes much larger than they.',NULL,NULL,NULL),(27,103,'de','Wulg',NULL,'Mini-Reisszahn-Wyvern aus den Hinterlanden. Er jagt im Rudel und greift auch Gegner an, die weitaus grsser sind als er.',NULL,NULL,NULL),(28,38,'de','Dmonjho','Kampf-Wyvern','Wegen seines beschleunigten Metabolismus ist ein Dmonjho stndig auf der Suche nach Beute. Er ist extrem brutal und dafr bekannt, grosse Monster in seinem Maul herumzuwirbeln.',NULL,NULL,NULL),(29,104,'de','Cortos',NULL,'Ein Flugdrache aus den Hinterlanden. Nicht aggressiv, greift manchmal Jger in Notlagen an. Sein Atem senkt Element-Widerstand.',NULL,NULL,NULL),(30,39,'de','Lavasioth','Fisch-Wyvern','Der Lavasioth nutzt geschmolzene Lava als Rstung. Er ist extrem aggressiv und wird ohne Zurckhaltung jede Bedrohung bis zum Tod angreifen.',NULL,'Wenn gehrtet',NULL),(31,100,'de','Gajalaka',NULL,'Kleine Monster, die Stammesmasken tragen.',NULL,NULL,NULL),(32,40,'de','Uragaan','Kampf-Wyvern','Dieser grosse Kampfwyvern nhrt sich an Erz, indem er mit seinen mchtigen Kiefern Gestein zu Pulver zermahlt. Er ist dafr bekannt, mit dem Lavasioth ber Gebiete zu kmpfen.',NULL,NULL,NULL),(33,141,'de','Boaboa',NULL,'Die Boaboa sind in der Lage, viele verschiedene Statusbeschwerden einzusetzen, um ihren Feinden Schaden zuzufgen. Sie ernhren sich von Pepe, zeigen jedoch auch Ehrerbietung gegenber den Kreaturen, indem sie sich verkleiden, um wie sie auszusehen, und mit den Herden durch die Raureif-Weite ziehen.',NULL,NULL,NULL),(34,41,'de','Azurner Rathalos','Flug-Wyvern','Eine azurfarbene Unterart des Rathalos. Beweglicher als ihre Standard-Verwandten, finden sie ihre Beute von der Luft aus und stossen tdlich herab.',NULL,NULL,NULL),(35,17,'de','Gross-Jagras','Reisszahn-Wyvern','Der Gross-Jagras ist der Rudelanfhrer der Jagras. Ist er hungrig, greift er auch Monster an, die strker sind als er. Hat er Beute im Bauch, schwillt dieser unglaublich an.',NULL,NULL,NULL),(36,104,'en','Cortos',NULL,'A wingdrake from the Hinterlands. Usually not aggressive, but may attack hunters in a bind. Its breath lowers elemental resistance.',NULL,NULL,NULL),(37,42,'de','Schwarze Diablos','Flug-Wyvern','Dieser schwarzgepanzerte Diablos ist eine lufige weibliche Diablos. Der Farbwechsel signalisiert ihre Aggressivitt und erhhte Grausamkeit anderen Kreaturen gegenber.',NULL,NULL,NULL),(38,18,'de','Kulu-Ya-Ku','Vogel-Wyvern','Ein seltsamer Vogelwyvern, der Extremitten entwickelt hat, die Waffen tragen knnen. Er wurde beim Klauen von Eiern im Uralten Wald und der Wildturm-dnis beobachtet.',NULL,NULL,NULL),(39,43,'de','Nergigante','Drachenltester','Ein schrecklicher Drachenltester, der auftaucht, wenn andere Drachenlteste in der Nhe sind. Seine Neigung zur Zerstrung ist wohlbekannt.',NULL,NULL,NULL),(40,100,'en','Gajalaka',NULL,'Small monsters wearing tribal masks.',NULL,NULL,NULL),(41,19,'de','Pukei-Pukei','Vogel-Wyvern','Der Krper dieses Vogelwyvern ist voller giftiger Stoffe. Zeugen zufolge verstaut er Streunsse in seinem Maul oder Schwanz, beschichtet sie mit Gift und spuckt sie dann auf Feinde.',NULL,NULL,NULL),(42,44,'de','Teostra','Drachenltester','Ein brutaler, in Flammen gehllter Drachenltester, der Feuer speit. Der Teostra ist derart wild und tdlich, dass die Gilde das Wanderverhalten von mglichst jedem Exemplar im Auge behlt.',NULL,NULL,NULL),(43,49,'de','Lunastra','Drachenltester','Ein unglaublich seltener, weiblicher Drachenltester; verteilt heissen blauen Staub in der Luft. Wurde mit dem Gegenstck Teostra gesehen.',NULL,NULL,NULL),(44,52,'en','Ancient Leshen','Relict','An old leshen that arrived through a portal to assume control over the Ancient Forest. Sometimes revered as an indigenous deity.',NULL,NULL,NULL),(45,45,'de','Kushala Daora','Drachenltester','Ein Drachenltester, in wilde Winde gehllt, durch die sich niemand nhern kann. Seine Haut besteht aus harten metallischen Schuppen.',NULL,NULL,NULL),(46,46,'de','Vaal Hazak','Drachenltester','Ein grotesker Drachenltester, der im tiefsten Teil des Tals der Verwesung zuhause ist. Er nutzt den tdlichen Schwaden in einer symbiotischen Beziehung.',NULL,NULL,NULL),(47,48,'de','Kulve Taroth','Drachenltester','Eine Drachenlteste, die sich mit einer glitzernden Metallschicht schtzt. Ihre kologie und ihr Fell ndern sich mit jedem Auftreten, daher die sorgfltige Untersuchung.',NULL,'Wenn mit Gold bedeckt',NULL),(48,20,'de','Barroth','Kampf-Wyvern','Der Barroth sucht stndig nach Ameisen, seinem Lieblingssnack, und markiert sein Territorium mit Schlamm. Kontrahenten erwarten anstrmende Angriffe.',NULL,'Wenn mit Schlamm bedeckt',NULL),(49,141,'en','Boaboa',NULL,'The Boaboa are capable of using many different status ailments to damage their foes. They feed on Popo, but also show reverence to the creatures, dressing up to look like them and travelling with the herds through the Hoarfrost Reach.',NULL,NULL,NULL),(50,47,'de','Xeno\'jiiva','Drachenltester','Eine neue Spezies, in den Tiefen der Heimat der ltesten gefunden. Ihre Verbindung zu anderen Drachenltesten ist so unklar wie ihre kologie.',NULL,NULL,NULL),(51,21,'de','Jyuratodus','Fisch-Wyvern','Dieser grosse Fischwyvern lebt in den Smpfen der Wildturm-dnis. Er nutzt Schlamm, um Beute zu fangen und fhrt Gebietskmpfe mit den Barroth.',NULL,'Wenn mit Schlamm bedeckt',NULL),(52,17,'en','Great Jagras','Fanged Wyvern','The pack leader of the Jagras. When hungry, Great Jagras are known to attack monsters even stronger than themselves. It balloons to unbelievable proportions after swallowing prey.',NULL,NULL,NULL),(53,111,'de','Beotodus','Fisch-Wyvern','Mit seinem keilfrmigen Kopf kann dieses Fischmonster durch den Tundraschnee schwimmen. Bewirft Beute hufig mit Schnee.',NULL,NULL,NULL),(54,22,'de','Tobi-Kadachi','Reisszahn-Wyvern','Dieser Reisszahn-Wyvern fliegt zwischen den Wipfeln des Uralten Waldes. Er ist bekannt dafr, den Boden und Bume zu streifen, um statische Elektrizitt im Fell aufzubauen.',NULL,NULL,NULL),(55,18,'en','Kulu-Ya-Ku','Bird Wyvern','An odd bird wyvern that has developed limbs capable of carrying weapons. It\'s been spotted stealing eggs from nests found in the Ancient Forest and Wildspire Waste.',NULL,NULL,NULL),(56,112,'de','Banbaro','Kampf-Wyvern','Ein Monster, das auf Gegner zustrmt und an seinen Zwillingshrnern zu erkennen ist, mit denen es Bume ausreisst und Erde aufwhlt.',NULL,NULL,NULL),(57,23,'de','Anjanath','Kampf-Wyvern','Der Anjanath durchstreift den Uralten Wald auf der Suche nach seinem Lieblingsmahl: Aptonoths. Dieses streitschtige Monster strzt sich ohne zu zgern auf jeden!',NULL,NULL,NULL),(58,19,'en','Pukei-Pukei','Bird Wyvern','A bird wyvern known to possess poisonous toxins in its body. It\'s been spotted storing scatternuts in its mouth or tail, coating them with poison and spitting them out at threats.',NULL,NULL,NULL),(59,24,'de','Rathian','Flug-Wyvern','Eine weibliche Wyvern, auch als \"Knigin des Landes\" bekannt. Mit ihrem giftabsondernden Schwanz und krftigen Beinen jagt sie Beute bevorzugt am Boden.',NULL,NULL,NULL),(60,113,'de','Viper-Tobi-Kadachi','Reisszahn-Wyvern','Diese Unterart hat einen giftigen Schwanz und einen lhmenden Biss. Sie kann auch gleiten, ohne zuvor Bume zu erklimmen.',NULL,NULL,NULL),(61,20,'en','Barroth','Brute Wyvern','Barroth seek out ants, their favorite snack, and mark their territory with mud. They attack potential rivals with their devastating charging attack.',NULL,'When covered in mud',NULL),(62,114,'de','Nachtschatten-Paolumu','Flug-Wyvern','Eine Paolumu-Unterart, die Beute in Schlaf versetzen kann. Sie produziert ein Betubungsmittel, das im Kehlsack aufbewahrt und bei Bedarf ausgestossen wird.',NULL,NULL,NULL),(63,25,'de','Tzitzi-Ya-Ku','Vogel-Wyvern','Dieses seltsame Monster blendet sowohl Beute als auch Feinde mit einem speziellen pulsierenden Organ in der Nhe seines Kopfs, bevor es mit seinen krftigen Beinen tdlich zutritt.',NULL,NULL,NULL),(64,115,'de','Korallen-Pukei-Pukei','Vogel-Wyvern','Ein Vogelwyvern, der Wasser in seinem Krper speichert. Wird er bedroht, kann er einen Strahl speien oder aus dem Schwanz abfeuern.',NULL,NULL,NULL),(65,26,'de','Paolumu','Flug-Wyvern','Der Paolumu ernhrt sich von Eiern, die er im Korallenhochland findet. Dank einzigartiger Scke in seinem Krper fliegt er durch die Luft und greift mit seinem harten Schwanz an.',NULL,NULL,NULL),(66,21,'en','Jyuratodus','Piscine Wyvern','A large piscine wyvern that inhabits the swamps of the Wildspire Waste. It uses mud to capture prey, and it\'s known to battle Barroth over territory.',NULL,'When covered in mud',NULL),(67,116,'de','Barioth','Flug-Wyvern','Ein schneeweisser Flugwyvern aus der Tundra. Er besitzt grosse Hauer und berquert Eis dank seiner Gliedmassen mit Leichtigkeit.',NULL,NULL,NULL),(68,27,'de','Gross-Girros','Reisszahn-Wyvern','Der Gross-Girros sucht nach Beute, die aus dem Korallenhochland herabgefallen ist, wobei er mit seinen riesigen lhmenden Zhnen gleichzeitig als Anfhrer eines Girros-Rudels fungiert.',NULL,NULL,NULL),(69,117,'de','Nargacuga','Flug-Wyvern','Dieser Flugwyvern mit obsidianfarbenem Fell ist enorm beweglich und besonders am Boden berraschend schnell.',NULL,NULL,NULL),(70,22,'en','Tobi-Kadachi','Fanged Wyvern','A fanged wyvern that flies among the trees of the Ancient Forest. Its penchant to brush against the ground and the trees as it moves around builds up static electricity within its fur.',NULL,NULL,NULL),(71,118,'de','Glavenus','Kampf-Wyvern','Ein Kampfwyvern, der seinen schweren, blauen Schwanz wie ein Schwert schwingt. Er wird mit jedem Hieb heisser, bis er glht.',NULL,NULL,NULL),(72,23,'en','Anjanath','Brute Wyvern','The Anjanath patrols the Ancient Forest, looking for its favorite meal, Aptonoth. This belligerent monster will attack anything without hesitation.',NULL,NULL,NULL),(73,28,'de','Radobaan','Kampf-Wyvern','Dieser gigantische Kampfwyvern frisst die Knochen der Kadaver im Tal der Verwesung; oder nutzt sie als Rstung. Er rollt sich fr Angriffe und zum Fortbewegen zusammen.',NULL,NULL,NULL),(74,119,'de','Tigrex','Flug-Wyvern','Ein Flugwyvern aus prhistorischen Zeiten mit ohrenbetubendem Schrei und krftigen Beinen, mit denen er ungestm anstrmt.',NULL,NULL,NULL),(75,24,'en','Rathian','Flying Wyvern','Wyverns known as the \"Queens of the Land.\" Terrestrial predators, they overpower prey with their venomous tails and powerful legs.',NULL,NULL,NULL),(76,29,'de','Legiana','Flug-Wyvern','Der Legiana ist das Apex-Monster des Korallenhochlandes, wo er sich von Raphinos ernhrt. Seinem Krper entstrmt ein eiskalter Wind, der die Bewegungen seiner Beute limitiert.',NULL,NULL,NULL),(77,120,'de','Brachydios','Kampf-Wyvern','Dieser meerblaue Kampfwyvern macht mithilfe seiner Spucke den klebrigen Schleim auf seinen riesigen Armen zu Sprengstoff.',NULL,NULL,NULL),(78,25,'en','Tzitzi-Ya-Ku','Bird Wyvern','This odd monster blinds both prey and enemies with a special pulsing organ near its head. It then uses its strong legs to deliver finishing blows.',NULL,NULL,NULL),(79,30,'de','Odogaron','Reisszahn-Wyvern','Ein entsetzliches Monster, das im Tal der Verwesung nach Aas sucht. Dank seiner hochaggressiven Natur ist alles und jeder eine potentielle Mahlzeit.',NULL,NULL,NULL),(80,121,'de','Schneesturm-Legiana','Flug-Wyvern','Eine Legiana-Art, deren Haut mit weissem Frost berzogen ist. Sie strmt eine eisige Klte aus und strzt sich dann von oben herab auf ihre erstarrte Beute.',NULL,NULL,NULL),(81,26,'en','Paolumu','Flying Wyvern','Paolumu feast on eggs found in the Coral Highlands. They are able to float through the air using unique sacs in their bodies, and attack with their extremely hard tails.',NULL,NULL,NULL),(82,122,'de','Fulgur-Anjanath','Kampf-Wyvern','Diese Anjanath-Unterart ldt Kiefer und Rckenmembran elektrisch auf, daher wird sie auch \"Donnerkiefer-Wyvern\" genannt.',NULL,'Wenn aufgeladen',NULL),(83,27,'en','Great Girros','Fanged Wyvern','A monster that scavenges for meals dropped from the Coral Highlands. It acts as the alpha leader of a Girros pack, and sports giant fangs that paralyze its prey.',NULL,NULL,NULL),(84,123,'de','Sure-Glavenus','Kampf-Wyvern','Eine Unterart des Glavenus aus dem Tal der Verwesung. Auf dem Schwanz ist eine tzende Flssigkeit kristallisiert, die Sure verteilt.',NULL,'Wenn kristallisiert',NULL),(85,28,'en','Radobaan','Brute Wyvern','A gigantic brute wyvern that eats the bones of carcasses found in the Rotten Vale, using some of it as armor. It also rolls into a ball as a form of attack and transportation.',NULL,NULL,NULL),(86,124,'de','Vulkan-Odogaron','Reisszahn-Wyvern','Diese Odogaron-Unterart ist immer auf der Suche nach Fressen, und oft trgt sie Beute im Maul herum. Verfllt in Fressraserei.',NULL,NULL,NULL),(87,29,'en','Legiana','Flying Wyvern','The apex monster of the Coral Highlands, whose diet primarily consists of Raphinos. It emits a chilling wind from its body, which dulls its prey\'s ability to escape.',NULL,NULL,NULL),(88,125,'de','Velkhana','Drachenltester','Ein Drachenltester, der jeden einfriert, der ihm zu nahe kommt. Der Legende nach kann er die Klte kontrollieren und mit seinem Atem massive Eiszapfen erschaffen.',NULL,NULL,NULL),(89,30,'en','Odogaron','Fanged Wyvern','A terrifying monster that scours the Rotten Vale for carrion. Its highly aggressive nature means that anything, be it monster or man, is a potential meal.',NULL,NULL,NULL),(90,126,'de','Brodelnder Bazelgeuse','Flug-Wyvern','Die Schuppen dieser Bazelgeuse-Variante sind heisser als normal. Ihre Anzahl nimmt mit der Zeit zu, der Explosionsradius steigt.',NULL,NULL,NULL),(91,31,'en','Rathalos','Flying Wyvern','The apex monster of the Ancient Forest, also known as the \"King of the Skies.\" A terrible wyvern that descends upon invaders, attacking with poison claws and fiery breath.',NULL,NULL,NULL),(92,127,'de','Velum-Vaal-Hazak','Drachenltester','Eine von Sporen berste Vaal-Hazak-Art, die alle, die ihr zu nahe kommen, reichlich mit giftigem Miasma bespuckt.',NULL,NULL,NULL),(93,32,'en','Diablos','Flying Wyvern','The apex monster of the Wildspire Waste. A menacing, territorial beast that lurks underground. Loud noises will cause it to lunge out of the sand in search of prey.',NULL,NULL,NULL),(94,128,'de','Namielle','Drachenltester','Ein Drachenltester, der mit Wasser benetzt ist und Blitze erzeugen kann. So setzt er Pftzen unter Strom und sorgt fr Dampf.',NULL,NULL,NULL),(95,33,'en','Kirin','Elder Dragon','Kirin are so rarely sighted that little is known of their ecology. It\'s been said they envelop themselves in pure electricity when they are provoked.',NULL,NULL,NULL),(96,129,'de','Wilder Dmonjho','Kampf-Wyvern','Eine mutierte Dmonjho-Variante im Hungerwahn. Er greift rcksichtslos alles an, was er sieht.',NULL,NULL,NULL),(97,34,'en','Zorah Magdaros','Elder Dragon','An elder dragon that rises from the earth like a volcano. Where it\'s headed, and why, the Research Commission has yet to figure out.',NULL,NULL,NULL),(98,130,'de','Ruinen-Nergigante','Drachenltester','Diese Nergigante-Variante wurde durch zahllose Kmpfe abgehrtet. Sie heilt sich, ausserdem hrten Verletzungen ihre Stacheln.',NULL,NULL,NULL),(99,35,'en','Dodogama','Fanged Wyvern','A monster that devours rocks as its primary diet. The crystals it devours mix with its saliva to produce explosive minerals that it can spit at its enemies.',NULL,NULL,NULL),(100,131,'de','Shara Ishvalda','Drachenltester','Ein mysteriser Drachenltester, der den Boden manipulieren kann. Die Vibrationen seiner Flgelspitzen verformen die Erde.',NULL,'Unbedeckt',NULL),(101,36,'en','Pink Rathian','Flying Wyvern','A subspecies with vibrant pink scales. Pink Rathians wield their toxic tails more deftly than normal Rathians, weakening prey with poison before moving in for the kill.',NULL,NULL,NULL),(102,37,'en','Bazelgeuse','Flying Wyvern','A nefarious flying wyvern that travels the New World in search of prey. It scatters explosive scales over a wide area to prey on whatever gets caught in the blast.',NULL,NULL,NULL),(103,132,'de','Zinogre','Reisszahn-Wyvern','Blitze durchzucken das Fell und den Panzer dieses scharfzhnigen Wyvern. Er ist am tdlichsten, wenn er berladen ist.',NULL,NULL,NULL),(104,38,'en','Deviljho','Brute Wyvern','Due to its enhanced metabolism, Deviljho must constantly seek out prey. It is extremely violent, and known to snatch up large monsters in its powerful maw and flail them around.',NULL,NULL,NULL),(105,133,'de','Yian Garuga','Vogel-Wyvern','Ein reizbarer Vogelwyvern mit harten schwarzen Schuppen und grosser Mhne. Sein besonderer Schnabel trifft hart!',NULL,NULL,NULL),(106,39,'en','Lavasioth','Piscine Wyvern','Lavasioths utilize molten lava as armor. They are extremely aggressive and will attack without prejudice until the threat has been eliminated.',NULL,'When hardened',NULL),(107,134,'de','Wundmal-Yian-Garuga','Vogel-Wyvern','Ein gehrteter Yian Garuga, der einen Kampf mit nur einer Narbe am Kopf berstanden hat. Nimm dich vor seinen Atemangriffen in Acht.',NULL,NULL,NULL),(108,135,'de','Brachial-Tigrex','Flug-Wyvern','Diese Tigrex-Unterart unterscheidet sich durch schwarzbraune Schuppen und lauteres Brllen. Sehr aggressiv, selbst fr Tigrex.',NULL,NULL,NULL),(109,40,'en','Uragaan','Brute Wyvern','Large brute wyverns that feed on ore, using their mighty jaws to crush solid rock to powder. They\'ve been known to confront Lavasioths over territory disputes.',NULL,NULL,NULL),(110,136,'de','Goldene Rathian','Flug-Wyvern','Eine seltene, goldene Rathian-Unterart. Umgeben von Hllenfeuer werden ihre Atem- und Schwanzangriffe gefhrlicher.',NULL,NULL,NULL),(111,41,'en','Azure Rathalos','Flying Wyvern','An azure-colored subspecies of Rathalos. More mobile than their standard cousins, they locate prey from the air and quickly swoop in for the kill.',NULL,NULL,NULL),(112,42,'en','Black Diablos','Flying Wyvern','These black-shelled Diablos are actually female Diablos in heat. The color signals their aggressiveness and heightened hostility to other creatures in their habitat.',NULL,NULL,NULL),(113,137,'de','Silberner Rathalos','Flug-Wyvern','Eine seltene, silberne Rathalos-Unterart. Umgeben von Hllenfeuer wird ihr Atem gefhrlicher und sie erhlt neue Angriffe.',NULL,NULL,NULL),(114,43,'en','Nergigante','Elder Dragon','A terrible elder dragon that appears when other elders are in the vicinity. Its penchant for destruction is well-documented.',NULL,NULL,NULL),(115,138,'de','Rajang','Reisszahn-Bestie','Eine extrem aggressive Kreatur, gegen die nur wenige berleben knnen. Hat krftige Arme. Wird goldfarben, wenn er verrgert ist.',NULL,NULL,NULL),(116,44,'en','Teostra','Elder Dragon','Brutal elder dragons wreathed in flames that spit blazing fire. Teostra are of such a fierce and deadly nature that the Guild closely monitors their movements.',NULL,NULL,NULL),(117,139,'de','Hllen-Zinogre','Reisszahn-Wyvern','Hat eine symbiotische Verbindung mit den Dracophag-Kfern, die er wie Kugeln \"freilsst\". Wird im Licht sogar noch gefhrlicher!',NULL,'Licht ausstrahlen',NULL),(118,49,'en','Lunastra','Elder Dragon','A rare female Elder Dragon that litters the air with hot blue dust. Reports of it traveling with her mate, Teostra, are still unconfirmed.',NULL,NULL,NULL),(119,145,'de','Frosthauer-Barioth','Flug-Wyvern','Diese Barioth-Variante kann ihren eiskalten Atemangriff nutzen, um Beute zu verlangsamen. Sei vorsichtig, denn dich betrifft das auch!',NULL,NULL,NULL),(120,140,'de','Safi\'jiiva','Drachenltester','Die ausgewachsene Form des Xeno\'jiiva. Er absorbiert Energie, um sich zu heilen und das kosystem zu verndern.',NULL,'ltestensiegel-Effizienz',NULL),(121,45,'en','Kushala Daora','Elder Dragon','An elder dragon that shields itself with fierce winds, preventing anyone from approaching it. Its skin consists of hard, metallic scales.',NULL,NULL,NULL),(122,46,'en','Vaal Hazak','Elder Dragon','A grotesque elder dragon that inhabits the deepest part of the Rotten Vale. It uses the fatal vapor of the vale in what appears to be a symbiotic relationship.',NULL,NULL,NULL),(123,142,'de','Zorniger Rajang','Reisszahn-Bestie','Eine von goldenem Fell bedeckte Rajang-Variante. Sie nutzt diverse Distanz- und Wandangriffe. Wird sie wtend, strahlt sie golden.',NULL,NULL,NULL),(124,48,'en','Kulve Taroth','Elder Dragon','An elder dragon that protects itself with a glittering coat of metal. Its ecology and coat differ with each appearance, thus the need for a thorough investigation.',NULL,'When covered in gold',NULL),(125,143,'de','Wtiger Brachydios','Kampf-Wyvern','Eine Brachydios-Variante, viel grsser als die Standardversion. Der Schleim auf dem Krper detoniert nach einer Weile.',NULL,NULL,NULL),(126,47,'en','Xeno\'jiiva','Elder Dragon','A new species discovered in the depths of the Elder\'s Recess. Its relationship to the other elder dragons is unclear, as is its ecology.',NULL,NULL,NULL),(127,144,'de','Alatreon','Drachenltester','Als Symbol der Zerstrung bekannt, sein Name wird vermieden. Angeblich kontrolliert er alle Elemente, aber die meisten, wenn nicht alle, Aufzeichnungen ber ihn wurden verbrannt.','Feuerform','Drachenform','Eisform'),(128,111,'en','Beotodus','Piscine Wyvern','This piscine monster\'s wedge-shaped head allows it to freely swim through the tundra snow. Frequently seen flinging snow at prey.',NULL,NULL,NULL),(129,112,'en','Banbaro','Brute Wyvern','A monster marked by its furious charge and by the majestic twin horns that uproot trees and gouge at the earth as it runs.',NULL,NULL,NULL),(130,146,'de','Fatalis','Drachenltester','Der legendre schwarze Drache, der ein ganzes Land in einer einzigen Nacht zerstrt und dessen Schloss niedergebrannt hat.',NULL,NULL,NULL),(131,113,'en','Viper Tobi-Kadachi','Fanged Wyvern','The tail of this subspecies secretes a toxin while its fangs paralyze prey. It can also glide without climbing trees.',NULL,NULL,NULL),(132,50,'de','Behemoth','Drachenltester','Eine mchtige Bestie aus einer anderen Welt. Ihre langen Hrner und starken Muskeln trotzen der Natur. Einzigartige Strategien sind ntig...',NULL,NULL,NULL),(133,51,'de','Waldschrat','Relikt','Diese Kreatur lebt tief im Wald und beherrscht mit seiner angeborenen Magie alle Tiere und Pflanzen in seinem Territorium.',NULL,NULL,NULL),(134,114,'en','Nightshade Paolumu','Flying Wyvern','A Paolumu subspecies capable of putting prey to sleep. It produces a powerful sedative gas stored within its throat sac that it can expel and scatter to knock unwary foes out.',NULL,NULL,NULL),(135,52,'de','Uralter Waldschrat','Relikt','Ein alter Waldschrat, durch ein Portal gekommen, um den Uralten Wald zu beherrschen; wird manchmal als Gottheit verehrt.',NULL,NULL,NULL),(136,115,'en','Coral Pukei-Pukei','Bird Wyvern','A bird wyvern that stockpiles water inside its body, fortified by the plant life it consumes. When threatened, it can expel a powerful stream from its mouth or tail.',NULL,NULL,NULL),(137,1,'en','Aptonoth',NULL,'Docile herbivores that graze in packs. Their meat is considered a delicacy and is rich in nutrients. If one member of the herd is attacked, the rest will flee immediately.',NULL,NULL,NULL),(138,116,'en','Barioth','Flying Wyvern','The snow-white flying wyvern with huge tusks found in the frozen tundra. It uses its forelegs and tail to traverse ice with ease.',NULL,NULL,NULL),(139,2,'en','Jagras',NULL,'Members of the Great Jagras pack, these smaller monsters will flee upon seeing one of their own perish. They\'re also known for ambushing larger monsters at a moment\'s notice.',NULL,NULL,NULL),(140,117,'en','Nargacuga','Flying Wyvern','Extremely agile, especially on the ground, this obsidian-furred flying wyvern moves with explosive bursts of speed.',NULL,NULL,NULL),(141,3,'en','Mernos',NULL,'Wingdrakes that feast on scatternuts. The flock will travel great distances when startled, making them an invaluable mode of transportation for clever hunters.',NULL,NULL,NULL),(142,118,'en','Glavenus','Brute Wyvern','A brute wyvern that wields its heavy, blue tail like a blade. It grows hotter and more keen with each strike until it glows red.',NULL,NULL,NULL),(143,4,'en','Vespoid',NULL,'Insects that paralyze their targets with their long stingers. They break easily, so attack them with poison or slinger ammo if you want to carve them.',NULL,NULL,NULL),(144,119,'en','Tigrex','Flying Wyvern','A flying wyvern straight out of prehistory, known for its deafening roar and powerful legs that drive its overwhelming charge.',NULL,NULL,NULL),(145,5,'en','Mosswine',NULL,'Mosswine are known for their excellent sense of smell, and are often found foraging for fungi. If you\'re hunting around for mushrooms, follow the Mosswine to the motherlode.',NULL,NULL,NULL),(146,120,'en','Brachydios','Brute Wyvern','This marine-blue brute wyvern uses its saliva to prime the sticky slime coating its massive arms, rendering it highly explosive.',NULL,NULL,NULL),(147,6,'en','Apceros',NULL,'Herbivores that inhabit the Wildspire Waste. They\'ve developed particularly hard hide to ward off attackers, and are known to gather in groups to defend themselves.',NULL,NULL,NULL),(148,121,'en','Shrieking Legiana','Flying Wyvern','A Legiana variant shrouded in white frost. It specializes in freezing prey with the powerful chill it emits, then swooping down to strike at them from overhead.',NULL,NULL,NULL),(149,7,'en','Kestodon',NULL,'Female Kestodon will alert the pack of danger, while the males will violently charge would-be threats. Their rushing charges can be blocked, however, leaving them open to attacks.',NULL,NULL,NULL),(150,122,'en','Fulgur Anjanath','Brute Wyvern','Feared as the \"Thunderjaw Wyvern,\" this Anjanath subspecies electrifies its jaws and dorsal membrane with every blow.',NULL,'When charged',NULL),(151,8,'en','Noios',NULL,'Wingdrakes that will produce a sound similar to screamer pods when startled. Use meat to get their attention, and then hunt them for materials, or use them as transportation.',NULL,NULL,NULL),(152,9,'en','Gajau',NULL,'Vicious piscine that form groups to defend their territory from intruders. Be sure not to venture too closely to their habitat!',NULL,NULL,NULL),(153,123,'en','Acidic Glavenus','Brute Wyvern','A subspecies of Glavenus found in the Rotten Vale. A corrosive fluid has crystallized on its tail, spraying acid with each swing.',NULL,'When crystallized',NULL),(154,10,'en','Kelbi',NULL,'Small herbivores known for their gentle demeanor and the medicinal properties of their horns. Those wishing to harvest a horn should aim for the head when attacking them.',NULL,NULL,NULL),(155,124,'en','Ebony Odogaron','Fanged Wyvern','This Odogaron subspecies is forever on the prowl for its next meal, and is often seen carrying fresh kills in its mouth. Reports indicate it goes into a frenzy upon eating.',NULL,NULL,NULL),(156,125,'en','Velkhana','Elder Dragon','An elder dragon said to freeze all in its path. According to legend, it can control the cold, and use its freezing breath to conjure massive spires of ice out of nowhere.',NULL,NULL,NULL),(157,11,'en','Raphinos',NULL,'Wingdrakes inhabiting the Coral Highlands. They group up to steal the eggs of other animals, but this in turn exposes them to the attention of larger, more vicious predators.',NULL,NULL,NULL),(158,12,'en','Shamos',NULL,'Small nocturnal monsters. They\'re particularly vulnerable to Tzitzi-Ya-Ku\'s blinding flash, but have been known to gang up on enemies.',NULL,NULL,NULL),(159,126,'en','Seething Bazelgeuse','Flying Wyvern','The scales of this Bazelgeuse variant burn hotter than normal, increasing in number and explosion radius as time passes.',NULL,NULL,NULL),(160,13,'en','Girros',NULL,'Monsters that are known to attack in packs, using the deadly vapor of the Rotten Vale to their advantage. They\'re known for crippling targets with their paralyzing fangs.',NULL,NULL,NULL),(161,127,'en','Blackveil Vaal Hazak','Elder Dragon','A Vaal Hazak variant encrusted with spores that spew a torrent of toxic effluvium at any who draw close.',NULL,NULL,NULL),(162,14,'en','Hornetaur',NULL,'Small insects that are found primarily on land. They\'re highly territorial and will attack anything that approaches them. Gather their materials by attacking them with the slinger.',NULL,NULL,NULL),(163,128,'en','Namielle','Elder Dragon','An elder dragon coated in water and able to freely control lightning. A unique organ allows it to pump electricity into the pools of water it creates, causing massive bursts of steam.',NULL,NULL,NULL),(164,15,'en','Gastodon',NULL,'Pack monsters that inhabit the Elder\'s Recess. They are easily angered by intruders, and will charge at monsters twice their size.',NULL,NULL,NULL),(165,129,'en','Savage Deviljho','Brute Wyvern','A mutated Deviljho variant, driven mad by its overpowering hunger. It will attempt to feed on all it sees.',NULL,NULL,NULL),(166,16,'en','Barnos',NULL,'Fervid wingdrakes that have flourished under harsh living conditions. They target intruders with a unique acidic agent, and then attack as a swarm.',NULL,NULL,NULL),(167,130,'en','Ruiner Nergigante','Elder Dragon','Countless battles have only hardened this Nergigante variant. In addition to healing, its spikes grow tougher as it loses health.',NULL,NULL,NULL),(168,131,'en','Shara Ishvalda','Elder Dragon','A mysterious elder dragon able to manipulate the earth itself. Vibrations from its wingtips reshape the earth, denying hunters footing.',NULL,'Uncovered',NULL),(169,132,'en','Zinogre','Fanged Wyvern','Lightning courses through the fur and unique plating of this fanged wyvern. It is most deadly in its supercharged state.',NULL,NULL,NULL),(170,133,'en','Yian Garuga','Bird Wyvern','A short-tempered bird wyvern marked by its hard, black scales and impressive mane. It strikes with its distinctive beak.',NULL,NULL,NULL),(171,134,'en','Scarred Yian Garuga','Bird Wyvern','A tempered Yian Garuga that survived a grueling battle with just a scar on its head. Be careful of its successive breath attacks.',NULL,NULL,NULL),(172,135,'en','Brute Tigrex','Flying Wyvern','Blackish brown scales and a stronger roar set this Tigrex subspecies apart. Extremely aggressive, even by Tigrex standards.',NULL,NULL,NULL),(173,136,'en','Gold Rathian','Flying Wyvern','A rare gleaming gold-scaled Rathian species. When wreathed in hellfire, its breath grows more lethal and its tail swipes broader.',NULL,NULL,NULL),(174,137,'en','Silver Rathalos','Flying Wyvern','A rare silver-scaled Rathalos species. When wreathed in hellfire, its breath grows more lethal and it gains a new set of attacks.',NULL,NULL,NULL),(175,138,'en','Rajang','Fanged Beast','An ultra-aggressive creature that few have a chance of surviving against. Sports powerful arms that pack a punch. Turns gold when angry.',NULL,NULL,NULL),(176,139,'en','Stygian Zinogre','Fanged Wyvern','Has a symbiotic relationship with Dracophage Bugs, which it releases like bullets. Becomes even more dangerous when covered in light.',NULL,'Emitting light',NULL),(177,145,'en','Frostfang Barioth','Flying Wyvern','A Barioth variant capable of spewing a sub-zero breath attack that it uses to slow down prey. Be careful, as this attack can freeze you as well.',NULL,NULL,NULL),(178,140,'en','Safi\'jiiva','Elder Dragon','The fully-grown form of Xeno\'jiiva. It absorbs energy from its environment to heal itself and change the ecosystem.',NULL,'Elderseal efficiency',NULL),(179,142,'en','Furious Rajang','Fanged Beast','A Rajang variant covered in golden fur. Utilizes severe ranged and wall-based attacks. It enters a glowing golden state when enraged.',NULL,NULL,NULL),(180,143,'en','Raging Brachydios','Brute Wyvern','A Brachydios variant that is much larger than the normal species. The slime on its body will activate over time and detonate.',NULL,NULL,NULL),(181,144,'en','Alatreon','Elder Dragon','Known as a symbol of destruction, people fear even uttering its name. It\'s rumored to control all of the elements, but most, if not all, records of its existence have been burned.','Fire form','Dragon form','Ice form'),(182,146,'en','Fatalis','Elder Dragon','The legendary black dragon that obliterated a country in a single night. It now presides in the ruins of its castle.',NULL,NULL,NULL),(183,50,'en','Behemoth','Elder Dragon','A powerful beast from another world. Its large horns and muscular frame defy nature. Unique strategies are required to battle it.',NULL,NULL,NULL),(184,51,'en','Leshen','Relict','Dwelling deep inside the forest, these creatures use their innate magic to control all flora and fauna within their territory.',NULL,NULL,NULL),(185,101,'en','Popo',NULL,'Long-furred herbivores native to the tundra. Gentle in nature, they flee when attacked, though grown males will defend their young.',NULL,NULL,NULL),(186,102,'en','Anteka',NULL,'Herbivores of the tundra that are slightly more aggressive than Kelbi, using their horns to fend off any attackers.',NULL,NULL,NULL);
