  CONSTRAINT `skilltree_text_skilltree_FK` FOREIGN KEY (`skilltree_id`) REFERENCES `skilltree` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=357 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
