INSERT INTO `tool_text` VALUES (1,1,'de','Ghillie-Mantel+',NULL,'Macht dich kurzzeitig unsichtbar. Wenn du angreifst oder Schaden erleidest, endet die Wirkung.'),(2,1,'en','Ghillie Mantle+',NULL,'Conceals you from enemy view temporarily. The effect expires if you perform an attack or take damage.'),(3,2,'de','Lebensretter-Mantel+',NULL,'Negiert den Schaden von kraftvollen Angriffen durch automatisches Ausweichen.'),(4,2,'en','Temporal Mantle+',NULL,'Nullifies damage from powerful attacks by automatically evading.'),(5,3,'de','Gesundheit-Booster+',NULL,'Platziert eine Rucher-Vorrichtung, die langsam deine Gesundheit regeneriert.'),(6,3,'en','Health Booster+',NULL,'Places a smoker that gradually restores your health.'),(7,4,'de','Trutzmantel+',NULL,'Eliminiert Schadensreaktionen, verhindert Windeffekte und schtzt dein Gehr sowie vor Erschtterungen. Mindert ausserdem Schaden von Angriffen.'),(8,4,'en','Rocksteady Mantle+',NULL,'Eliminates damage reactions, prevents wind effects, protects your hearing, and grants tremor resistance. You also receive less damage from attacks.'),(9,5,'de','Herausforderer-Mantel+',NULL,'Lenkt die Aufmerksamkeit von Monstern auf dich, wodurch du sie leichter anlocken kannst. Der Effekt endet, wenn du angegriffen wirst.'),(10,5,'en','Challenger Mantle+',NULL,'Prompts monsters to target you more often and makes them easier to lure. The effect expires if you are attacked.'),(11,6,'de','Lebenskraft-Mantel+',NULL,'Negiert eine bestimmte Schadensmenge  danach endet der Effekt.'),(12,6,'en','Vitality Mantle+',NULL,'Negates a fixed amount of damage, after which the effect expires.'),(13,7,'de','Feuerschutz-Mantel+',NULL,'Reduziert Feuerelement-Schaden und negiert Feuerpest, Explosionspest, sowie Schaden von heissen Umgebungen.'),(14,7,'en','Fireproof Mantle+',NULL,'Reduces fire damage, nullifies fireblight and blastblight, and prevents damage from hot environments.'),(15,8,'de','Wasserschutz-Mantel+',NULL,'Reduziert Wasserelement-Schaden. Negiert Wasserpest und Bewegungseinschrnkungen in tiefem Wasser sowie Schlamm.'),(16,8,'en','Waterproof Mantle+',NULL,'Reduces water damage, nullifies waterblight, reduces mobility restrictions in muck and negates them entirely for deep water.'),(17,9,'de','Eisschutz-Mantel+',NULL,'Reduziert Eiselement-Schaden und negiert Eispest.'),(18,9,'en','Iceproof Mantle+',NULL,'Reduces ice damage and nullifies iceblight.'),(19,10,'de','Donnerschutz-Mantel+',NULL,'Reduziert Donnerelement-Schaden und negiert Donnerpest sowie Lhmung.'),(20,10,'en','Thunderproof Mantle+',NULL,'Reduces thunder damage and nullifies thunderblight and paralysis.'),(21,11,'de','Drachenschutz-Mantel+',NULL,'Reduziert Drachenelement-Schaden. Negiert Drachenpest und verbessert die Drachen-Eigenschaften deiner Waffe.'),(22,11,'en','Dragonproof Mantle+',NULL,'Reduces dragon damage, nullifies dragonblight, and powers up your weapon\'s dragon properties.'),(23,12,'de','Reiniger-Booster+',NULL,'Platziert eine Rucher-Vorrichtung, die alle anomalen Statuseffekte und elementbasierten Pestarten aufhebt.'),(24,12,'en','Cleanser Booster+',NULL,'Places a smoker that removes any abnormal status effects and elemental blights.'),(25,13,'de','Gleiter-Mantel+',NULL,'Du springst lnger und kannst auf Winden reiten. Erleichtert zudem den Aufstieg auf Monster.'),(26,13,'en','Glider Mantle+',NULL,'Increases jump airtime and grants the power to ride strong winds. Also makes it easier to mount monsters.'),(27,14,'de','Ausweich-Mantel+',NULL,'Macht beim Ausweichen lnger unverwundbar; zudem kurzzeitiger Angriffsbonus beim Ausweichen eines Angriffs im letzten Moment.'),(28,14,'en','Evasion Mantle+',NULL,'Increases the invulnerability window while evading and grants a temporary attack boost for evading a monster attack at the very last moment.'),(29,15,'de','Aufschlag-Mantel+',NULL,'Fgt den meisten Angriffen einen Betubungseffekt hinzu oder verstrkt einen bestehenden Betubungseffekt.'),(30,15,'en','Impact Mantle+',NULL,'Adds a stun effect to most attacks or increases the potency of an existing stun effect.'),(31,16,'de','Apotheker-Mantel+',NULL,'Hufigere Status-Ansammlungen beim Angriff mit Waffen, die anomale Statuseffekte verursachen.'),(32,16,'en','Apothecary Mantle+',NULL,'Increases the probability of triggering status buildup when attacking with weapons that induce abnormal statuses.'),(33,17,'de','Immunitt-Mantel+',NULL,'Entfernt und negiert alle anomalen Statuseffekte, solange die Wirkung andauert.'),(34,17,'en','Immunity Mantle+',NULL,'Removes and nullifies all abnormal status effects for the duration of the effect.'),(35,18,'de','Affinitt-Booster+',NULL,'Platziert eine Rucher-Vorrichtung, die die Affinitt erhht.'),(36,18,'en','Affinity Booster+',NULL,'Places a smoker that increases affinity.'),(37,19,'de','Banditen-Mantel+',NULL,'Monster lassen seltene Wertobjekte fallen, wenn du sie angreifst.'),(38,19,'en','Bandit Mantle+',NULL,'Causes monsters to drop rare trade-in items when you attack them.'),(39,20,'de','Assassinenkapuze+',NULL,'Erhht die Bewegungsgeschwindigkeit und erlaubt schnelleres Verstecken. Richtet bei einem arglosen Monster grossen Schaden an und endet dann.'),(40,20,'en','Assassin\'s Hood+',NULL,'Increases movement speed and allows you to hide quicker. Deals big damage to a monster caught unaware, then the effect ends.');
/*!40000 ALTER TABLE `tool_text` ENABLE KEYS */;
